L'or des anges 

This film by Philippe Reypens from 1998 traces the history of he most celebrated
choirs of the Western tradition along with the personal development of the singers'individual careers.

A must see for everyone with an interest in classical music in general and the Gold of Angels in particular.

Avi,52 min, 0,99 GB 
IMBD-rating 8,6/10

